‘𝐌𝐞𝐥 𝐁’ brows….. 

usually clients come in with pictures of 𝐦𝐲 work of 𝑶𝒕𝒉𝒆𝒓 𝒂𝒓𝒕𝒊𝒔𝒕𝒔’ work for their ‘  𝓘𝓷𝓼𝓹𝓸 ‘ …. This mad one came in with a MAGAZINE that she picked up 4 DAYS PRIOR to her app and said she will ‘have brows like hers’ 😂😂😂😂😂😂💀💀💀💀

- think it’s safe to say we smashed it and we’ve given scary spice @officialmelb a run for her money.

𝐓𝐨 𝐦𝐲 𝐟𝐞𝐥𝐥𝐨𝐰 𝐏𝐌𝐔 𝐚𝐫𝐭𝐢𝐬𝐭𝐬: 𝐰𝐡𝐚𝐭’𝐬 𝐭𝐡𝐞 𝐜𝐫𝐚𝐳𝐢𝐞𝐬𝐭/𝐮𝐧𝐮𝐬𝐮𝐚𝐥 ‘𝐢𝐧𝐬𝐩𝐨’ 𝐩𝐢𝐜𝐬 𝐲𝐨𝐮’𝐯𝐞 𝐛𝐞𝐞𝐧 𝐠𝐢𝐯𝐞𝐧 👇🏼👇🏼👇🏼👇🏼👇🏼👇🏼👇🏼

